h4. Test Case ID: UBS-113

*Objective:* Verify behavior when setting an empty string for string properties.
*Pre-conditions:* {{UserBean}} object is instantiated.
*Steps to Execute:*

# Create an instance of {{UserBean}}.
# Call setters with an empty string for all string properties:
#* {{setFName("")}}
#* {{setLName("")}}
#* {{setPWord("")}}
#* {{setAddr("")}}
#* {{setMailId("")}}
# Call corresponding getters.
*Expected Results:*
All getters return an empty string {{""}}.
*Actual Results:*
All getters returned an empty string {{""}}

h4. Test Case ID: UBS-112

*Objective:* Verify behavior when setting {{null}} values for string properties.
*Pre-conditions:* {{UserBean}} object is instantiated.
*Steps to Execute:*

# Create an instance of {{UserBean}}.
# Call setters with {{null}} for all string properties:
#* {{setFName(null)}}
#* {{setLName(null)}}
#* {{setPWord(null)}}
#* {{setAddr(null)}}
#* {{setMailId(null)}}
# Call corresponding getters.
*Expected Results:*
All getters return {{null}}.
*Actual Results:*
All getters returned {{null}}.

h4. Test Case ID: TMS-104

*Objective:* Verify behavior when {{transId}} is set after setting inherited properties.
*Pre-conditions:* {{HistoryBean}} object is instantiated.
*Steps to Execute:*

# Create an instance of {{HistoryBean}}.
# Set inherited properties:
#* {{setMailId("user@example.com")}}
#* {{setTr_no("TR9876")}}
#* {{setDate("2024-12-10")}}
#* {{setFrom_stn("SFO")}}
#* {{setTo_stn("SEA")}}
#* {{setSeats(3)}}
#* {{setAmount(350.00)}}
# Call {{setTransId("TXN54321")}}.
# Retrieve all properties, including {{transId}}.
*Expected Results:*
All properties, including {{transId}}, return the correct values.
*Actual Results:*
All properties returned the correct values.

h4. Test Case ID: TMS-99

*Objective:* Verify behavior when both {{transId}} and inherited properties are set and retrieved.
*Pre-conditions:* {{HistoryBean}} object is instantiated.
*Steps to Execute:*

# Create an instance of {{HistoryBean}}.
# Set multiple properties:
#* {{setTransId("TXN56789")}}
#* {{setMailId("test@example.com")}}
#* {{setTr_no("TR5678")}}
#* {{setDate("2024-12-12")}}
#* {{setFrom_stn("CHI")}}
#* {{setTo_stn("LA")}}
#* {{setSeats(4)}}
#* {{setAmount(400.00)}}
# Retrieve all values using corresponding getters.
*Expected Results:*
All properties return the values set in Step 2.
*Actual Results:*
All properties returned the correct values.

h4. Test Case ID: TMS-98

*Objective:* Verify that the {{HistoryBean}} class inherits the functionality of {{BookingDetails}}.
*Pre-conditions:* {{HistoryBean}} object is instantiated.
*Steps to Execute:*

# Create an instance of {{HistoryBean}}.
# Call inherited methods:
#* {{setMailId("test@example.com")}}
#* {{setTr_no("TR1234")}}
#* {{setDate("2024-12-11")}}
#* {{setFrom_stn("NYC")}}
#* {{setTo_stn("BOS")}}
#* {{setSeats(2)}}
#* {{setAmount(500.00)}}
# Retrieve values using corresponding inherited getters.
*Expected Results:*
All inherited methods work as expected, returning the correct values.
*Actual Results:*
Inherited methods returned the correct values.

h4. Test Case ID: TMS-008

*Objective:* Verify that multiple properties can be set and retrieved correctly in sequence.
*Pre-conditions:* {{BookingDetails}} object is instantiated.
*Steps to Execute:*

